import React from 'react'
import Crossword from '@jaredreisinger/react-crossword';

export default function Puzzle1() {

    const data = {
        /* ... puzzle data (see below) ... */
        across: {
            1: {
              clue: 'one plus one',
              answer: 'TWO',
              row: 0,
              col: 0,
            },
          },
          down: {
            2: {
              clue: 'three minus two',
              answer: 'ONE',
              row: 0,
              col: 2,
            },
          },
    };

    return (
        <Crossword data={data} />
    )
}
